    false,nt"url": null,nt"notes": "During the 2011 breeding season, 4u2010egg
    clutches of piping plover (Charadrius melodus) eggs were collected from single nests
    located at Rachel Carson National Wildlife Refuge in Maine and Monomoy National
    Wildlife Refuge in Massachusetts. The nest at Rachel Carson NWR was abandoned, and
    the nest at Monomoy NWR was incubated for an extended period before the eggs were
    deemed nonviable. The eggs were combined into two locationu2010specific composite
    samples and analyzed by the U.S. Fish and Wildlife Service for dioxins, furans,
    dioxinu2010like polychlorinated biphenyl congeners, other organochlorine compounds,
    polybrominated diphenyl ether, perfluorochemicals, and trace metals.",nt"license_title":
